package com.example.fptacademysystem.dto;import java.io.Serializable;public class TeacherTimetableDTO implements Serializable {    private int timetableid;    private int teaid;    public TeacherTimetableDTO(int timetableid, int teaid) {        super();        this.timetableid = timetableid;        this.teaid = teaid;    }    public TeacherTimetableDTO() {        super();    }    public int getTimetableid() {        return timetableid;    }    public void setTimetableid(int timetableid) {        this.timetableid = timetableid;    }    public int getTeaid() {        return teaid;    }    public void setTeaid(int teaid) {        this.teaid = teaid;    }}